  return (
    <HotDjradioWrapper>
      <div className="header">
        <h3 className="settle-singer">热门主播</h3>
      </div>
      <div className="artist-container">
        {/* {hotDjradio.map(item => {
          return <HotCoverInfo key={item.picUrl} info={item} />
        })} */}
      </div>
    </HotDjradioWrapper>
  )
})
